import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import CurrentResult from "./pages/CurrentResult";
import SearchHistory from "./pages/SearchHistory";
import "./App.css";

function App() {
  return (
    <Router>
      <div className="App min-h-screen bg-gradient-to-r from-indigo-500 via-purple-500 to-pink-500">
        {/* Navbar */}
        <nav className="flex justify-center space-x-4 py-4 bg-black bg-opacity-70">
          <Link to="/" className="text-white text-lg py-2 px-4 hover:bg-white hover:text-black rounded-lg">Inicio</Link>
          <Link to="/history" className="text-white text-lg py-2 px-4 hover:bg-white hover:text-black rounded-lg">Historial</Link>
        </nav>

        <div className="container mx-auto py-8">
          <Routes>
            <Route path="/" element={<CurrentResult />} />
            <Route path="/history" element={<SearchHistory />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
